import { ChevronRight, ExternalLink } from 'lucide-react';

export default function Projects() {
  const projects = [
    {
      title: "Brain Tumor Detection App",
      description: "Built a mobile app using React Native (Expo) to detect brain tumors from MRI scans with a CNN-based deep learning model.",
      bgClass: "bg-gradient-to-r from-blue-400 to-indigo-500",
      iconColor: "text-blue-600",
      features: [
        "Deployed on Hugging Face using Docker",
        "Connected via Flask API for real-time predictions",
        "Intuitive and responsive mobile interface"
      ],
      links: [
        {
          label: "Brain Tumor Model",
          url: "huggingface.co/Kushal2125/BrainTumorDetection",
          bgClass: "bg-blue-100 text-blue-800"
        }
      ]
    },
    {
      title: "Fitness Tracker Website",
      description: "Created a responsive full-stack fitness tracking web app to log health metrics and monitor personal goals.",
      bgClass: "bg-gradient-to-r from-green-400 to-teal-500",
      iconColor: "text-green-600",
      features: [
        "Integrated supervised learning for personalized suggestions",
        "Generated diet and workout plans based on user data",
        "Deployed on Render.com for seamless access"
      ],
      links: [
        {
          label: "Live API",
          url: "https://syntaxsquad-n7kl.onrender.com",
          bgClass: "bg-green-100 text-green-800"
        }
      ]
    },
    {
      title: "Safarnama - Travel Platform",
      description: "Built and deployed a full-stack travel website using MongoDB, Express.js, React.js, and Node.js.",
      bgClass: "bg-gradient-to-r from-purple-400 to-pink-500",
      iconColor: "text-purple-600",
      features: [
        "Advanced filtering for tour packages by multiple criteria",
        "JWT-based authentication and admin panel",
        "Integrated Nodemailer for email communication"
      ],
      links: [
        {
          label: "Live Site",
          url: "https://safarnamadeploy-1.onrender.com/",
          bgClass: "bg-purple-100 text-purple-800"
        }
      ]
    }
  ];

  return (
    <section id="projects" className="py-16 bg-white">
      <div className="container mx-auto px-4 md:px-8">
        <h2 className="text-3xl font-bold text-center mb-12">Featured Projects</h2>
        
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
          {projects.map((project, index) => (
            <div key={index} className="bg-white rounded-lg shadow-lg overflow-hidden hover:shadow-xl transition-shadow duration-300">
              <div className={`h-48 ${project.bgClass} flex items-center justify-center`}>
                <h3 className="text-xl font-bold text-white">{project.title}</h3>
              </div>
              <div className="p-6">
                <p className="text-slate-600 mb-4">
                  {project.description}
                </p>
                <ul className="mb-4 space-y-2">
                  {project.features.map((feature, idx) => (
                    <li key={idx} className="flex items-start">
                      <ChevronRight size={18} className={`${project.iconColor} mr-1 mt-1 flex-shrink-0`} />
                      <span className="text-slate-700 text-sm">{feature}</span>
                    </li>
                  ))}
                </ul>
                <div className="flex gap-2">
                  {project.links.map((link, idx) => (
                    <a 
                      key={idx}
                      href={link.url} 
                      target="_blank" 
                      rel="noopener noreferrer"
                      className={`text-xs ${link.bgClass} px-2 py-1 rounded flex items-center`}
                    >
                      <ExternalLink size={12} className="mr-1" /> {link.label}
                    </a>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
